import React from 'react';
import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";
import styled from 'styled-components';
import { createGlobalStyle } from 'styled-components';
//Pages
import Login from './component/page/Login';
import MainPage from './component/page/MainPage';
import LoginMainPage from './component/page/LoginMainPage';
import EntireScholar from './component/page/EntireScholar';
import RecomScholar from './component/page/RecomScholar';

const MainTitleText = styled.p`
    font-size: 24px;
    font-weight: bold;
    text-align: center;

`;

const GlobalStyle = createGlobalStyle`
    body {
        background: linear-gradient(to bottom, #ffffff, #f0f0f0); /* Vertical gradient from white to light gray */
        /* Other global styles */
        margin: 0; /* Remove default margin */
        font-family: Arial, sans-serif; /* Example: set default font family */
    }
`;

function App(props) {
  return (
    <BrowserRouter>
        <MainTitleText>SCHOLLI</MainTitleText>
        <Routes>
        <GlobalStyle />
          <Route index element={<MainPage />} />
          <Route path="login" element={<Login />} />
          <Route path="main" element={<MainPage />} />
          <Route path="loginmain" element={<LoginMainPage />} />
          <Route path="entirescholar" element={<EntireScholar />} />
          <Route path="recomscholar" element={<RecomScholar />} />
        </Routes>
        </BrowserRouter>
  );
}

export default App;
